  [],\n\t\"revision_timestamp\": \"2015-05-06T22:26:44.663258\",\n\t\"name\": \"nir-detector-signal-chain-development-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"&lt;p&gt;The objectives of this proposal
  are twofold: 1) develop a suite of flight software tools for utilizing the advanced
  capabilities inherent in the guide-mode features of the present generation of near-infrared
  detectors, and 2) develop an implementation of sample-up-the-ramp processing for
  NIR detector readouts that gracefully handles signal saturation and cosmic-ray hits
  during an exposure.&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&lt;p&gt;The objectives
  of the guide mode software development are to learn how to generate optimal clocking
  sequences for interleaving rapid readout of multiple guide windows with slower readout
  of science data from the rest of the detector, and to develop software to implement
  these sequences in the SIDECAR&amp;trade; ASIC for use in flight applications.&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;\",\n\t\"license_title\":
